var http = require('http');
var https = require('https');

function httpHttpsRequest(routeObj, httpHandle, callback) {
	try {
		var params = require('querystring').stringify(routeObj.msg_data);
		var contentType = 'application/x-www-form-urlencoded';
		if (routeObj.content_type == 'application/json') {
			contentType = routeObj.content_type;
			params = JSON.stringify(routeObj.msg_data);
		}
		else if (routeObj.content_type == 'urlbody') {
			params = encodeURIComponent(JSON.stringify(routeObj.msg_data));			
		}
		var options = { 
			host: routeObj.route_ip, 
			port: routeObj.route_port,
			path: routeObj.route_path,
			method: routeObj.route_method,
			headers: {
				'Content-Type':contentType,
				'Content-Length':params.length
		}};
		console.log('outHttp:' + JSON.stringify(options));
		var req = httpHandle.request(options, function(res) {
			res.setEncoding('utf8');
			var _data='';
			res.on('data', function (chunk) {
				_data+=chunk;
			});
			res.on('end', function(){
				return callback(null, _data);
			});				
		});
		req.on('error', function(e) {
			console.log('posUtil:httpRequest,options:' + JSON.stringify(routeObj) + ',err:' + e);
			return callback(e, null);
		});
		req.write(params + '\n');
		req.end();		
	}
	catch (e) {
		return callback(e, null);
	}	
}

exports.httpRequest = function(routeObj, callback) {
	httpHttpsRequest(routeObj, http, callback);
}

exports.httpsRequest = function(routeObj, callback) {
	httpHttpsRequest(routeObj, https, callback);
}


